/**
初始化一个数组，
数组下边即为 与1900年的偏移量，记录当年的 人口数（当年出生人数 - 当年死亡数）
遍历 出生年份 ，根据 给对应年份+1
遍历 死亡年份 ，根据 给对应年份-1
对数组进行累加计算，生成当年 存活总人数（累加往年 人口数 ）

*/
func maxAliveYear(birth []int, death []int) int {
	lives := make([]int, 102)

	for _, birthyear := range birth {
		lives[birthyear-1900]++
	}
	for _, deathyear := range death {
		lives[deathyear-1900+1]--
	}

	preSum := make([]int, 102)
	preSum[0] = lives[0]
	for i := 1; i < len(preSum); i++ {
		preSum[i] = lives[i] + preSum[i-1]
	}

	maxlives := -1
	minyear := 0
	for i := 0; i < len(preSum); i++ {
		if preSum[i] > maxlives {
			minyear = i + 1900
			maxlives = preSum[i]
		}
	}
	return minyear

}

